package com.hmmes.bean;

public class GsdeBean extends BaseBean {		private Integer id;//   主键	private String sbmcdek;//   工序设备名称	private String gxxh;//   工序产品型号	private String gxgg;//   工序产品规格	private String gxdy;//   工序电压等级	private String gxlb;//   计算工时定额用的类别	private Double dgrs;//   定岗人数	private Double fthpgs;//   分摊换盘时间，标准=12小时，管绞机在数据库中设置为：6小时	private Double fxprl;//   放线盘容量（米）	private Double gdzbgs;//   固定准备工时，每班给予，单位：分钟	private Double zbgs;//   准备工时，每段产品给予，单位：分钟	private Double qygs;//   牵引工时，单位：分钟	private Double sdgs;//   实动工时，单位：小时	private Double fzgs;//   辅助工时，单位：分钟	private Double hsxpgs;//   换收线盘工时，单位：分钟
	public Integer getId() {	    return this.id;	}	public void setId(Integer id) {	    this.id=id;	}	public String getSbmcdek() {	    return this.sbmcdek;	}	public void setSbmcdek(String sbmcdek) {	    this.sbmcdek=sbmcdek;	}		public String getGxxh() {	    return this.gxxh;	}	public void setGxxh(String gxxh) {	    this.gxxh=gxxh;	}	public String getGxgg() {	    return this.gxgg;	}	public void setGxgg(String gxgg) {	    this.gxgg=gxgg;	}	public String getGxdy() {	    return this.gxdy;	}	public void setGxdy(String gxdy) {	    this.gxdy=gxdy;	}	public String getGxlb() {	    return this.gxlb;	}	public void setGxlb(String gxlb) {	    this.gxlb=gxlb;	}	public Double getDgrs() {	    return this.dgrs;	}	public void setDgrs(Double dgrs) {	    this.dgrs=dgrs;	}		public Double getFthpgs() {	    return this.fthpgs;	}	public void setFthpgs(Double fthpgs) {	    this.fthpgs=fthpgs;	}	public Double getFxprl() {	    return this.fxprl;	}	public void setFxprl(Double fxprl) {	    this.fxprl=fxprl;	}	public Double getGdzbgs() {	    return this.gdzbgs;	}	public void setGdzbgs(Double gdzbgs) {	    this.gdzbgs=gdzbgs;	}	public Double getZbgs() {	    return this.zbgs;	}	public void setZbgs(Double zbgs) {	    this.zbgs=zbgs;	}	public Double getQygs() {	    return this.qygs;	}	public void setQygs(Double qygs) {	    this.qygs=qygs;	}	public Double getSdgs() {	    return this.sdgs;	}	public void setSdgs(Double sdgs) {	    this.sdgs=sdgs;	}						public Double getFzgs() {	    return this.fzgs;	}	public void setFzgs(Double fzgs) {	    this.fzgs=fzgs;	}		public Double getHsxpgs() {	    return this.hsxpgs;	}	public void setHsxpgs(Double hsxpgs) {	    this.hsxpgs=hsxpgs;	}		}
